const host = insomnia.environment.get("host")
const session_id = insomnia.environment.get("test-session-id");

const url = "http://localhost:8080/session/" + session_id

const response = await new Promise((resolve, reject) => {
  insomnia.sendRequest(
    url,
    (error, response) => {
      error != null ? reject(error) : resolve(response);
    }
  );
});

const tokens = JSON.parse(response.body).state.tokens

if (tokens != null && tokens.length > 0) {
	insomnia.environment.set("test-token-id", tokens[0].id);
	console.log("token_id: " + insomnia.environment.get("test-token-id"))
} else {
	throw new Error("No active token"); 
}

